import { Fragment } from "react";



const App = () => {

  const prices = {
    halberd: ["Arak - 400gp"],
    brassArmor: []
  }

  return (
    <section 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <div>Arak</div>
    </section>
  )
}

export default App;
